import { Component, OnInit } from '@angular/core';
import { UsersService } from 'src/app/services/users.service';
import { ActivatedRoute } from '@angular/router';
import { Router } from '@angular/router';
@Component({
  selector: 'app-user-album-photos',
  templateUrl: './user-album-photos.component.html',
  styles: [
  ]
})
export class UserAlbumPhotosComponent {
  album:any;
  UserId:any;
  constructor( myRoute:ActivatedRoute,public UService: UsersService, public router:Router){
    this.UserId = myRoute.snapshot.params["id"];
    console.log(myRoute.snapshot.params);


  }

ngOnInit(): void {
      this.UService.GetAllAlbumsbyuserId(this.UserId).subscribe({
    next:(data)=>{
      // console.log(data)
      this.album = data;
    },
    error:(err)=>{console.log(err)}
  })
}
}
